export default function BlogPage() {

    const blog = data.blogPosts[useParams()];


    console.log(blogId);



    return (
        <div> 
            <h1>This is blog { blogId }</h1>
            <h2>Written by: { blog.author.lastName } </h2>
        </div>
    );
}
